struct aggr 
aggr_static_uint8_t(char **records, 
                    size_t num_records, 
                    size_t field_offset, 
                    bool if_aggr_common) {
  
  struct aggr aggr;
  if (num_records == 0) {
    aggr.num_values = 0;
    aggr.values = NULL;
    return aggr;
  }
  if (if_aggr_common) {
    aggr.num_values = 1;
    aggr.values = (uint64_t *)malloc(sizeof(uint64_t));
    if (aggr.values == NULL)
      perror("malloc");
    aggr.values[0] = *(uint8_t *)(records[0] + field_offset);
  }
  return aggr;
}

